import ReactDOM from 'react-dom';
import React,{ useEffect, useState } from "react";
import styles from './App.module.css';
import { BrowserRouter, Routes, Route, NavLink } from "react-router-dom";
import Navbar from "./Navbar"
import Firstfloor from "./component/firstfloor"
import Secondfloor from "./component/secondfloor"
import Thirdfloor from "./component/thirdfloor"
import Fourthfloor from "./component/fourthfloor"




function App() {
 
    
    return (
        <body classname={styles.backgroundImage} style={{backgroundImage: `url('bg.png')`, height:'970px'}}>
           <>
      <Navbar />
      <div>
        <Routes>
          <Route path="/firstfloor" element={<Firstfloor />} />
          <Route path="/secondfloor" element={<Secondfloor />} />
          <Route path="/thirdfloor" element={<Thirdfloor />} />
          <Route path="/fourthfloor" element={<Fourthfloor />} />
        </Routes>
      </div>
    </>
    <div className={styles.welcomebox}>
    <div className={styles.roomName}><p style={{fontFamily: 'Arial, Helvetica, sans-serif', fontWeight: 300, fontSize: 'xxx-large', color: 'white', marginTop:'5%'}}>Welcome to Doo-SIT</p></div>
    <div className={styles.roomName}><p style={{fontFamily: 'Arial, Helvetica, sans-serif', fontWeight: 300, fontSize: 'x-large', color: 'white'}}>Web application for providing information and assistance through virtual locations.</p></div>
    <a href="https://webapp3.sit.kmutt.ac.th/booking/web/day.php?year=2022&month=11&day=14&area=2&room=17" target="_blank">
  <button className={styles.buttonL28}> Click here to see room schedule </button></a>
    
    </div>
          
        </body>
      );
}


export default App;
